textOriginal:
Promessas que Bolsonaro NÃO cumpriu:
-Acabar com o foro privilegiado;
-Acabar com a corrupção (ele conseguiu encobrir a dele e da sua família);
-Acabar com a mamata, afinal o cartão corporativo dele está em sigilo de 100 anos;
-Ser um presidente cristão, quando ele representa demónios como o "pastor" Mala;
-Melhorar a economia, afinal agora muitos são aqueles que têm que optar entre comer osso de primeira ou de segunda.
-Acabar com o bolsa-família por ser comunismo mas mudou o nome para auxílio Brasil quando achou que seria uma boa medida para comprar votos;
-Acabar com a demarcação de terras indígenas, deixando os índios à mercê do garimpo sem ter que legislar sobre a sua ideia macabra.
